import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {


      nft1: {
        name: 'Jack',
      },
      nft2: {
        name: 'Frank',
      },
      nft3: {
        name: 'Andrew',
      },
    };
  }

  render() {
    return (
      <div className='App'>
        <h1>{this.state.nft1.name}</h1>
        <h1>{this.state.nft2.name}</h1>
      </div>
    );
  }
}

export default App;
